import './index.scss';
import {Link, NavLink, useNavigate} from "react-router-dom";

const Navbar = () => (
    <section id={ 'nav' }>
            <NavLink to={ '/' } id={ 'logo' }>
                Card Me Daddy
            </NavLink>
    </section>
);

export default Navbar;
